import React, { useContext } from 'react'
import { FullName } from './Fields'
import { Data, DataWrapContext, UseData } from './Store'

export default function Form() {
    const data = UseData()
    return (
        <div>
            <DataWrapContext>
                <FullName />
            </DataWrapContext>

            <Data.Provider value={data}>
                {data}
            </Data.Provider>
        </div>
    )
}
